import { Box, Table, Button, TableHead, Typography, TableCell, TableRow, TableBody } from '@mui/material';
import { useParams } from 'react-router-dom';
import { Patient } from '../types';

interface Props {
    patients: Patient[]
}

const PatientPage = (patientsArray: Props) => {
    const id = useParams().id;

    console.log(patientsArray.patients)
    
    const patient = patientsArray.patients.find(p => p.id === id);

    if (!patient) {
        return(
            <div>
                Invalid id
            </div>
        )
    }
    
    return(
        <div>
            {patient?.name}
        </div>
    );
};

export default PatientPage;
